import React, { useRef, useState, useEffect } from 'react'
import { Canvas, useFrame, useThree } from '@react-three/fiber'
import { useGLTF, Html, PerspectiveCamera } from '@react-three/drei'
import { createRoot } from 'react-dom/client'
import './styles.css'
import { App } from './App'

function Model({ url, position, scale, onClick }) {
  const { scene } = useGLTF(url)
  const ref = useRef()

  useFrame((state, delta) => {
    ref.current.rotation.y += delta * 0.5
  })

  return (
    <primitive 
      ref={ref}
      object={scene} 
      position={position} 
      scale={scale}
      onClick={(e) => {
        e.stopPropagation()
        onClick()
      }}
    />
  )
}

function ResponsiveModel({ url, side, onClick, label }) {
  const { viewport } = useThree()
  const [position, setPosition] = useState([0, 0, 0])
  const [scale, setScale] = useState(1)

  useEffect(() => {
    const xPos = side === 'left' ? -viewport.width / 2 + 1 : viewport.width / 2 - 1
    const yPos = -viewport.height / 2 + 1
    setPosition([xPos, yPos, 0])
    setScale(Math.min(viewport.width, viewport.height) * 0.1)
  }, [viewport, side])

  return (
    <>
      <Model 
        url={url} 
        position={position} 
        scale={scale} 
        onClick={onClick}
      />
      <Html position={[position[0], position[1] - 0.5, position[2]]}>
        <div style={{ color: 'white', fontSize: '1rem', textAlign: 'center', pointerEvents: 'none' }}>{label}</div>
      </Html>
    </>
  )
}

function CameraButton({ onClick }) {
  return (
    <button 
      onClick={(e) => {
        e.stopPropagation()
        onClick()
      }}
      style={{
        position: 'fixed',
        bottom: '20px',
        left: '50%',
        transform: 'translateX(-50%)',
        padding: '10px 20px',
        fontSize: '1rem',
        backgroundColor: 'rgba(255, 255, 255, 0.2)',
        color: 'white',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
        zIndex: 1000
      }}
    >
      Move Camera
    </button>
  )
}

function Scene() {
  const cameraRef = useRef()
  const [cameraPosition, setCameraPosition] = useState([0, 0, 5])

  const moveCameraRandomly = () => {
    const newX = Math.random() * 10 - 5
    const newY = Math.random() * 10 - 5
    const newZ = Math.random() * 5 + 3
    setCameraPosition([newX, newY, newZ])
  }

  const openLink = (url) => {
    window.open(url, '_blank')
  }

  return (
    <>
      <PerspectiveCamera ref={cameraRef} position={cameraPosition} makeDefault />

      <ambientLight intensity={0.5} />
      <pointLight position={[10, 10, 10]} />

      <ResponsiveModel 
        url="/pump.glb" 
        side="left"
        onClick={() => openLink("https://pump.fun/")}
        label="PUMP.FUN"
      />

      <ResponsiveModel 
        url="/pump.glb" 
        side="right"
        onClick={() => openLink("https://t.me/SnapshotsInTimePortal")}
        label="Telegram"
      />
    </>
  )
}

function Root() {
  const [cameraPosition, setCameraPosition] = useState([0, 0, 5])

  const moveCameraRandomly = () => {
    const newX = Math.random() * 10 - 5
    const newY = Math.random() * 10 - 5
    const newZ = Math.random() * 5 + 3
    setCameraPosition([newX, newY, newZ])
  }

  const styles = {
    container: {
      position: 'relative',
      width: '100vw',
      height: '100vh',
      overflow: 'auto',
    },
    title: {
      position: 'fixed',
      top: '20px',
      left: 0,
      width: '100%',
      textAlign: 'center',
      fontSize: 'clamp(2rem, 5vw, 4rem)',
      color: 'white',
      pointerEvents: 'none',
      zIndex: 1000,
    },
    canvasWrapper: {
      position: 'fixed',
      top: 0,
      left: 0,
      width: '100%',
      height: '100%',
      pointerEvents: 'none',
    },
    canvas: {
      pointerEvents: 'auto',
    }
  }

  return (
    <div style={styles.container}>
      <App />
      <div style={styles.canvasWrapper}>
        <Canvas style={styles.canvas}>
          <Scene cameraPosition={cameraPosition} />
        </Canvas>
      </div>
      <CameraButton onClick={moveCameraRandomly} />
      <div className='tit press-start-2p-regular' style={styles.title}>
        Snapshots in Time
      </div>
    </div>
  )
}

createRoot(document.getElementById('root')).render(<Root />)
